zingchart.widgets.dashboard_container = {
    parse : function(data) {
        var x = data.x || 0;
        var y = data.y || 0;
        var w = data.width || 240;
        var h = data.height || 240;
        var id = data.id || "dash";        
        var backgroundColor1 = data.backgroundColor1 || "#232526";
        var backgroundColor2 = data.backgroundColor2 || "#202122";
        
        var json = {
            labels:[
            ],
            shapes:[
                {
                    type:"poly",
                    zIndex:-1000,
                    points:[[x,y],
                    [x+w+1,y],
                    [x,y+h+1]],
                    backgroundColor:backgroundColor1,
                    flat:true
                },
                {
                    type:"poly",
                    zIndex:-1000,
                    points:[[x+w,y+h],
                    [x+w,y],
                    [x,y+h]],
                    backgroundColor:backgroundColor1 + " " + backgroundColor2,
                    fillAngle:180,
                    fillOffsetX:w/4,
                    flat:true
                }
            ]
        };
        return json;
    }
};
 

zingchart.widgets.dashboard_metric = {
    percent : function(percent) {
        var ps = (String(Math.abs(percent))).split('.');
        var p1 = ps[0] || '0';
        var p2 = ps[1] || '00';
        return p1 + "<span style=\"font-size:12px\">." + p2 + "%</span>";
    },
    update : function(chartid, snippetid, params) {
        var value = parseFloat(Number(1000*Math.random()).toFixed(2));
        var percent = parseFloat(Number(-10 + 20*Math.random()).toFixed(2));
        zingchart.exec(chartid, 'updateobject', {
            data:[
                {
                    objtype:"label",
                    id:snippetid+"_value_sh",
                    text:value
                },{
                    objtype:"label",
                    id:snippetid+"_value",
                    text:value
                },{
                    objtype:"label",
                    id:snippetid+"_percent",
                    color:(percent>0)?"#77AB13":"#AE432E",
                    text:zingchart.widgets.dashboard_metric.percent(percent)
                },{
                    objtype:"shape",
                    id:snippetid+"_trend",
                    angle:(percent>0)?0:180,
                    backgroundColor:(percent>0)?"#77AB13":"#AE432E"
                }
            ]
        });
    },
    parse : function(data) {
        var x = data.x || 0;
        var y = data.y || 0;
        var w = data.width || 240;
        var h = data.height || 240;
        var id = data.id || "dash";
        var title = data.title || "";
        var value = data.value || "";
        var percent = data.percent || 0;
    
        var json = zingchart.widgets.dashboard_container.parse(data);
        
        window.setInterval(function() {
            zingchart.widgets.dashboard_metric.update(data.loader.id, id, {
                
            });
        }, 2000+parseInt(2000*Math.random(), 10));
        
        json.labels.push(
            {
                text:title,
                color:"#eee",
                fontSize:13,
                bold:true,
                x:x,
                y:y,
                width:w,
                textAlign:"left",
                padding:"8 8 8 28",
                flat:true
            },
            {
                text:value,
                id:id+"_value_sh",
                color:"#000",
                fontSize:13,
                x:x+12,
                y:y+42,
                flat:true
            },
            {
                text:value,
                id:id+"_value",
                color:"#eee",
                fontSize:13,
                x:x+10,
                y:y+40,
                flat:true
            },
            {
                text:zingchart.widgets.dashboard_metric.percent(percent),
                id:id+"_percent",
                color:(percent>0)?"#77AB13":"#AE432E",
                fontSize:11,
                x:x+45,
                y:y+65,
                flat:true
            }        
        );
    
        json.shapes.push(
            {
                type:"line",
                points:[[x,y+33],
                [x+w,y+33]],
                lineWidth:1,
                lineColor:"#121314",
                flat:true
            },
            {
                type:"line",
                points:[[x,y+34],
                [x+w,y+34]],
                lineWidth:1,
                lineColor:"#303334",
                flat:true
            },
            {
                type:"circle",
                x:x+16,
                y:y+16,
                size:6,
                fillAngle:45,
                fillOffsetX:4,
                fillOffsetY:4,
                backgroundColor:"#556D2C #384820",
                flat:true
            },
            {
                type:"triangle",
                id:id+"_trend",
                shadow:true,
                shadowDistance:2,
                shadowColor:"#000",
                x:x+30,
                y:y+75,
                size:6,
                angle:(percent>0)?0:180,
                backgroundColor:(percent>0)?"#77AB13":"#AE432E",
                flat:true
            }
        );
        return json;
    }
};
 
